import './App.scss';
import Home from './Component/Home.js';
import Header from './Component/Header.jsx';
import NotFound from './NotFound.js';
import { BrowserRouter as Router, Route, Routes} from 'react-router-dom'

function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <div className="content">
          <Routes>
            <Route exact path="/">
              <Home />
            </Route>
            <Route path="*"> 
              <NotFound />
            </Route>
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
